const t=JSON.parse('{"key":"v-37d91502","path":"/posts/2023/Claude%E5%90%84%E7%89%88%E6%9C%AC%E4%B9%8B%E9%97%B4%E7%9A%84%E5%B7%AE%E5%BC%82%E6%98%AF%E4%BB%80%E4%B9%88.html","title":"Claude 各版本之间的差异是什么？","lang":"zh-CN","frontmatter":{"date":"2023-07-01T09:44:16.000Z","description":"Claude 各版本之间的差异是什么？ 在 Claude 官网上有两个版本：Claude 与 Claude Instant。在 poe 上面有三个版本：Claude-instant、Claude-instant-100k 和 Claude-2-100k，Claude2 自己对这三个版本的差异解答是： Claude-instant、Claude-instant-100k 和 Claude-2-100k 都是 Anthropic 公司开发的大型语言模型，主要的区别在于： 模型大小不同 Claude-instant: 4 亿参数 Claude-instant-100k: 10 亿参数 Claude-2-100k: 200 亿参数 训练数据量不同 Claude-instant 和 Claude-instant-100k 都是在较小的数据集上训练的。 Claude-2-100k 是在超过 100,000 本书上的大规模数据集上训练的。 生成能力不同 参数更多、训练数据更多的模型生成能力更强。 Claude-2-100k 的生成语言更流畅，内容更丰富，能够进行更长时间的对话。 可用性不同 Claude-instant 免费开放使用。 Claude-instant-100k 和 Claude-2-100k 需要付费使用。 总体来说，Claude 系列的三个模型是同一系列的升级版本，参数、数据集和生成能力逐步提升，但需要付费使用的版本也逐步增加。","head":[["meta",{"property":"og:url","content":"https://yishulun.com/posts/2023/Claude%E5%90%84%E7%89%88%E6%9C%AC%E4%B9%8B%E9%97%B4%E7%9A%84%E5%B7%AE%E5%BC%82%E6%98%AF%E4%BB%80%E4%B9%88.html"}],["meta",{"property":"og:site_name","content":"艺述论博客"}],["meta",{"property":"og:title","content":"Claude 各版本之间的差异是什么？"}],["meta",{"property":"og:description","content":"Claude 各版本之间的差异是什么？ 在 Claude 官网上有两个版本：Claude 与 Claude Instant。在 poe 上面有三个版本：Claude-instant、Claude-instant-100k 和 Claude-2-100k，Claude2 自己对这三个版本的差异解答是： Claude-instant、Claude-instant-100k 和 Claude-2-100k 都是 Anthropic 公司开发的大型语言模型，主要的区别在于： 模型大小不同 Claude-instant: 4 亿参数 Claude-instant-100k: 10 亿参数 Claude-2-100k: 200 亿参数 训练数据量不同 Claude-instant 和 Claude-instant-100k 都是在较小的数据集上训练的。 Claude-2-100k 是在超过 100,000 本书上的大规模数据集上训练的。 生成能力不同 参数更多、训练数据更多的模型生成能力更强。 Claude-2-100k 的生成语言更流畅，内容更丰富，能够进行更长时间的对话。 可用性不同 Claude-instant 免费开放使用。 Claude-instant-100k 和 Claude-2-100k 需要付费使用。 总体来说，Claude 系列的三个模型是同一系列的升级版本，参数、数据集和生成能力逐步提升，但需要付费使用的版本也逐步增加。"}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:locale","content":"zh-CN"}],["meta",{"property":"og:updated_time","content":"2023-08-11T01:48:18.000Z"}],["meta",{"property":"article:author","content":"LIYI"}],["meta",{"property":"article:published_time","content":"2023-07-01T09:44:16.000Z"}],["meta",{"property":"article:modified_time","content":"2023-08-11T01:48:18.000Z"}],["script",{"type":"application/ld+json"},"{\\"@context\\":\\"https://schema.org\\",\\"@type\\":\\"Article\\",\\"headline\\":\\"Claude 各版本之间的差异是什么？\\",\\"image\\":[\\"\\"],\\"datePublished\\":\\"2023-07-01T09:44:16.000Z\\",\\"dateModified\\":\\"2023-08-11T01:48:18.000Z\\",\\"author\\":[{\\"@type\\":\\"Person\\",\\"name\\":\\"LIYI\\",\\"url\\":\\"https://yishulun.com/\\"}]}"]]},"headers":[],"git":{"createdTime":1689986752000,"updatedTime":1691718498000,"contributors":[{"name":"LIYI","email":"9830131@qq.com","commits":5}]},"readingTime":{"minutes":2.48,"words":743},"filePathRelative":"posts/2023/Claude各版本之间的差异是什么.md","localizedDate":"2023年7月1日","excerpt":"<h1> Claude 各版本之间的差异是什么？</h1>\\n<p>在 Claude 官网上有两个版本：Claude 与 Claude Instant。在 poe 上面有三个版本：Claude-instant、Claude-instant-100k 和 Claude-2-100k，Claude2 自己对这三个版本的差异解答是：</p>\\n<blockquote>\\n<p>Claude-instant、Claude-instant-100k 和 Claude-2-100k 都是 Anthropic 公司开发的大型语言模型，主要的区别在于：</p>\\n<ol>\\n<li>模型大小不同</li>\\n</ol>\\n<ul>\\n<li>Claude-instant: 4 亿参数</li>\\n<li>Claude-instant-100k: 10 亿参数</li>\\n<li>Claude-2-100k: 200 亿参数</li>\\n</ul>\\n<ol start=\\"2\\">\\n<li>训练数据量不同</li>\\n</ol>\\n<ul>\\n<li>Claude-instant 和 Claude-instant-100k 都是在较小的数据集上训练的。</li>\\n<li>Claude-2-100k 是在超过 100,000 本书上的大规模数据集上训练的。</li>\\n</ul>\\n<ol start=\\"3\\">\\n<li>生成能力不同</li>\\n</ol>\\n<ul>\\n<li>参数更多、训练数据更多的模型生成能力更强。</li>\\n<li>Claude-2-100k 的生成语言更流畅，内容更丰富，能够进行更长时间的对话。</li>\\n</ul>\\n<ol start=\\"4\\">\\n<li>可用性不同</li>\\n</ol>\\n<ul>\\n<li>Claude-instant 免费开放使用。</li>\\n<li>Claude-instant-100k 和 Claude-2-100k 需要付费使用。</li>\\n</ul>\\n<p>总体来说，Claude 系列的三个模型是同一系列的升级版本，参数、数据集和生成能力逐步提升，但需要付费使用的版本也逐步增加。</p>\\n</blockquote>","copyright":{"author":"LIYI","license":"CC BY-NC-ND 4.0"},"autoDesc":true}');export{t as data};
